    false,nt"url": null,nt"notes": "In February and March of 1954 a project
    was undertaken on Amohitka Island in the Aleutians by the U.S. Fish and Wildlife
    Service with collaboration by the Agricultural Experiment Station, Purdue University,
    for the purpose of studying the physiology of the sea otter (Enhydra lutris), with
    special attention to the problem of captivity mortality. Determinations were made
    of various blood components, organ weights, gastro-enteric activity, temperature
    control, and pathology of normal sea otters and compared with animals which had
